/* Utilities */
/*** Element selection à la jQuery ***/
var $ = function(q) { return document.querySelector(q); }
var $$ = function(q) { return document.querySelectorAll(q); }

/*** Gestión de localStorage ***/
function _(key, value) {
	if (value) {
		if (value == "")
			localStorage.removeItem(key);
		else
			localStorage.setItem(key, value);
	}
	
	return localStorage[key] || false;
}

/* Date and time */
var dateAndTime = function() {
	// display time
	var displayTime = function() {
		var time = new Date();
		var hour = time.getHours() < 10 ? '0'+time.getHours() : time.getHours();
		var mins = time.getMinutes() < 10 ? '0'+time.getMinutes() : time.getMinutes();
		$('.clock').textContent = hour+':'+mins;
	}

	displayTime();
	
	var clockint = setInterval(displayTime, 1000);
	
	// display date
	var time = new Date();
	var days = ["Domingo", "Lunes", "Martes", "Miércoles", "Jueves", "Viernes", "Sábado"];
	var day = days[time.getDay()]+' '+time.getDate();
	var months = ["Enero", "Febrero", "Marzo", 'Abril', 'Mayo', 'Junio', 'Julio', 'Agosto', 'Septiembre', 'Octubre', 'Noviembre', 'Diciembre'];
	var month = months[time.getMonth()];
	var year = time.getFullYear();
	$('.date').textContent = day+' '+month+' '+year;

	if (time.getDate() == 29 && time.getMonth() == 4) // Cumpleaños!
		$(".message").textContent = "Feliz cumpleaños!!! :)";
	if (time.getDay() == 0 && time.getDate() < 8 && time.getMonth() == 4) // Dia de la madre!
		$(".message").textContent = "Feliz dia de la Madre!!! :)";
};

window.addEventListener("load", dateAndTime);

/* Wallpaper management */
var wallpaper = {
	load: function() {
		var curwp = _("wallpaper_url");
		var custom_wp = true;
		
		if (!curwp) {
			wallpaper.save("back/luminance.jpg"); // Default wallpaper
		}
		
		$("body").style.backgroundImage = "url('" + _("wallpaper_url") + "')";
		
		var list = ["astral", "dreamy", "elegance", "gaia", "luminance", "moonbeam", "pearl", "radient", "void"];
		var setwphtml = "";
		
		for (var w in list) {
			var name = list[w];
			var wpurl = "back/" + name + ".jpg";

			setwphtml += '<input type="radio" name="wp-select" class="wp-select"'

			if (wpurl == _("wallpaper_url")) {
				custom_wp = false;
				setwphtml += "checked='checked'";
			}

			setwphtml += ' value="back/' + name + '.jpg" id="select-' + name + '" /><label for="select-' + name + '" style="background-image:url(back/' + name + '_min.jpg)">' + name + '</label>';
		}
		
		setwphtml += '<input type="radio" name="wp-select" class="wp-select" value="custom" id="select-custom" /><label for="select-custom">custom</label><input type="text" id="custom_wp_url" placeholder="http://example.com/wallpaper.jpg" />';
		
		$("form#wallpaper_settings").innerHTML = setwphtml;
		
		if (custom_wp) {
			$("#select-custom").checked = "checked";
			$("#custom_wp_url").value = _("wallpaper_url");
		}

		$("form#wallpaper_settings").onchange = function() {
			wallpaper.save($("form#wallpaper_settings input:checked").value);
		}
	},
	save: function(newwp) {
		if (newwp == "custom") {
			_("wallpaper_url", $("#custom_wp_url").value);
		} else {
			_("wallpaper_url", newwp);
		}
		
		$("body").style.backgroundImage = "url('" + _("wallpaper_url") + "')";
	}
};

window.addEventListener("load", wallpaper.load);

/* Touch and scroll */
document.addEventListener('touchmove', function (e) { e.preventDefault(); }, false);



var grid = {
	itemsize: 5,
	load: function(force) {
		if (_("genhtml") && !force) {
			$("#scrollable").innerHTML = _("genhtml");
		} else {
			$("#scrollable").innerHTML = "";
			var ncols = _("customcols") ? parseInt(_("customcols")) : 40;
			var nrows = _("customrows") ? parseInt(_("customrows")) : 12;

			$("#grid-cols").value = ncols;
			$("#grid-rows").value = nrows;

			$('#scrollable').style.width = (ncols*(grid.itemsize+1.5))+'rem';
			$('#scrollable').style.height = (nrows*(grid.itemsize+1.5)+1.5)+'rem';
			for (var i=0; i<nrows; i++) {
				for (var j = 0; j<ncols; j++) {
					var e = document.createElement('a');
					e.setAttribute("data-row", i);
					e.setAttribute("data-col", j);
					if (!_("item"+i+'_'+j)) {
						e.className = 'empty item row'+i+' col'+j;
						
						if ($('.used.row'+(i-1)+'.col'+j)) {
							e.className += ' topborder';
						}
						if ($('.used.row'+i+'.col'+(j-1))) {
							e.className += ' leftborder';
						}
					} else {
						e.className = 'used item row'+i+' col'+j;
						var a = JSON.parse(_("item"+i+'_'+j));
						for (x in a) {
							e[x] = a[x];
						}
						e.target = "_top";
						if (a.href && (!a.style || !a.style.backgroundImage))
							try {
								a.style.backgroundImage = 'url('+a.href.split('://')[0] + "://" + a.href.split('://')[1].split('/')[0] + "/favicon.ico)";
							} catch(e) {}
						if (a.style && a.style.backgroundImage)
							e.style.backgroundImage = a.style.backgroundImage;
						
						//if (a.href) e.style.backgroundImage = 'url(http://grabicon.com/'+ a.href.split('://')[1].split('/')[0]+'.png)';
						
						if ($('.empty.row'+(i-1)+'.col'+j)) {
							$('.empty.row'+(i-1)+'.col'+j).className += ' bottomborder';
						}
						if ($('.empty.row'+i+'.col'+(j-1))) {
							$('.empty.row'+i+'.col'+(j-1)).className += ' rightborder';
						}
					}
					$('#scrollable').appendChild(e);
				}
			}
			grid.position();

			_("genhtml", $("#scrollable").innerHTML)
		}
		grid.setEvents();

		window.myScroll = new IScroll('#wrapper', {scrollX: true, scrollY: true, scrollbars: 'custom', fadeScrollbars: true, shrinkScrollbars: 'clip', freeScroll: true});
	},
	position: function() {
		var topmargin = 1.5;
		var leftmargin = 0;
		var horspacing = 1.5; // Margin = 0.1, padding = 2*0.7 
		var verspacing = 1.5; 
		var allitems = $$('.item');
		for (var i in allitems) {
			var e = allitems[i];
			try {
				var row = e.getAttribute("data-row");
				var col = e.getAttribute("data-col");
				e.style.left = (col*grid.itemsize+col*horspacing+leftmargin)+'rem';
				e.style.top = (row*grid.itemsize+row*verspacing+topmargin)+'rem';
			} catch (e) {}
		}
	},
	setEvents: function() {
		for (var i in $$(".item")) {
			var e = $$(".item")[i];
			try {
				var hammertime = Hammer(e).on("hold", function(event) {
					event.preventDefault();
					var i = parseInt(this.getAttribute("data-row"));
					var j = parseInt(this.getAttribute("data-col"));
					config.showItemDialog(i, j);
			    });
			} catch(e) {}
		}

		$("#grid-cols").onchange = function() {
			_("customcols", this.value);
		};
		$("#grid-rows").onchange = function() {
			_("customrows", this.value);
		};
	}
};
window.addEventListener("load", grid.load);

var config = {
	showItemDialog: function (i, j) {
		var content = "";
		var lskey = "item"+i+"_"+j;
		if (_(lskey)) {
			var v = JSON.parse(_(lskey));
			$("#item-title").value = $("#item-link-name").value = v.textContent;
			$("#item-link-url").value = v.href ? v.href : "";

			if (v.className.indexOf("group") > -1)
				$("#item-type-title").checked = "checked";
			else
				$("#item-type-link").checked = "checked";
		} else {
			$("#item-type-empty").checked = "checked";
			$("#item-link-name").value = $("#item-link-url").value = $("#item-title").value = "";
		}

		$("#item_settings").onchange = function() {
			console.log("onchange");
			var item = {
				className : "",
				href : "",
				textContent : "",
				style: {}
			};

			if ($("#item-type-link").checked) {
				console.log("link");
				item.className = 'used item row'+i+' col'+j;
				item.href = $("#item-link-url").value;
				item.textContent = $("#item-link-name").value;

				if ($("#item-link-favicon").value.length > 0) {
					item.style = {};
					item.style.backgroundImage = "url(\"" + $("#item-link-favicon").value + "\")";
				}

				item.href = (item.href.indexOf("://") > -1 ? "" : "http://") + item.href;
				_(lskey, JSON.stringify(item));
			} else if ($("#item-type-title").checked) {
				item.className = 'used item group row'+i+' col'+j;
				delete item.href;
				item.textContent = $("#item-title").value;
				_(lskey, JSON.stringify(item));
			} else if ($("#item-type-empty").checked) {
				_("item"+i+'_'+j, "");
			}
		};

		$(".config-back").style.display = "block";
		$("#dialog-item").style.display = "block";
	},
	showWallpaperDialog: function() {
		$(".config-back").style.display = "block";
		$("#dialog-wallpaper").style.display = "block";
	},
	closeDialogs: function() {
		for (var d in $$(".dialog")) {
			var dialog = $$(".dialog")[d];
			try {
				if (dialog.style.display != "none")
					dialog.style.display = "none";
			} catch(e) {}
		}
		$(".config-back").style.display = "none";
		grid.load(true);
		return false;
	}
}

window.addEventListener("load", function() {
	for (var c in $$(".close_dialog")) {
		try {
			$$(".close_dialog")[c].addEventListener("click", config.closeDialogs);
		} catch(e) {}
	}
});

window.addEventListener("load", function() {
	var bghammer = Hammer($("#scrollable")).on("doubletap", function(event) {
		event.preventDefault();
		config.showWallpaperDialog();
	});
});

